import React from 'react'
import Icon from 'antd/es/icon'
import '../App.css'
export default class Search extends React.Component{
    render(){
        return(
            <div className='search'>
                <input className='search' placeholder='search here' style={{border:'black solid 1px',outline:'none',borderRadius:'3px',marginBottom:'5px',width:'650px',height:'38px',padding:'1px 7px',position:"absolute",top:"10px"}}/>
                <Icon type="search" style={{marginLeft:'-20px',cursor:'pointer',verticalAlign:'sub'}}/>
            </div>
        )
    }
}
